-- tables 1FN
DROP TABLE IF EXISTS locations1;

CREATE TABLE locations1 (
  NoClient integer,
  NomClient varchar(100),
  AdresseClient varchar(100),
  NoDVD integer,
  PrixAchat integer,
  Titre varchar(100),
  Duree integer,
  NomEditeur varchar(100),
  AdresseEditeur varchar(100),
  Realisateur varchar(100),
  AnneeSortie integer,
  Genre varchar(100),
  DateLocation date,
  DureeLocation integer,
  PRIMARY KEY (NoDVD, DateLocation)
 );

----------------------------------------
-- tables 2FN
DROP TABLE IF EXISTS locations2, dvds2 CASCADE;

CREATE TABLE dvds2 (
  NoDVD integer,
  PrixAchat integer,
  Titre varchar(100),
  Duree integer,
  NomEditeur varchar(100),
  AdresseEditeur varchar(100),
  Realisateur varchar(100),
  AnneeSortie integer,
  Genre varchar(100),
  PRIMARY KEY (NoDVD)
 );

 CREATE TABLE locations2 (
  NoDVD integer,
  DateLocation date,
  NoClient integer,
  NomClient varchar(100),
  AdresseClient varchar(100),
  DureeLocation integer,
  PRIMARY KEY (NoDVD, DateLocation),
  FOREIGN KEY (NoDVD) references dvds2(NoDVD)
);

----------------------------------------
-- tables 3FN
DROP TABLE IF EXISTS locations3, dvds3, films3, editeurs3, clients3 CASCADE;

CREATE TABLE editeurs3 (
  NomEditeur varchar(100),
  AdresseEditeur varchar(100),
  PRIMARY KEY (NomEditeur)
);

CREATE TABLE films3 (
  Titre varchar(100),
  Duree integer,
  NomEditeur varchar(100),
  Realisateur varchar(100),
  AnneeSortie integer,
  Genre varchar(100),
  PRIMARY KEY (Titre),
  FOREIGN KEY (NomEditeur) REFERENCES editeurs3(NomEditeur)
);

CREATE TABLE dvds3 (
  NoDVD integer,
  PrixAchat integer,
  Titre varchar(100),
  PRIMARY KEY (NoDVD),
  FOREIGN KEY (Titre) REFERENCES films3(Titre)
);

CREATE TABLE clients3 (
  NoClient integer,
  NomClient varchar(100),
  AdresseClient varchar(100),
  PRIMARY KEY (NoClient)  
);

CREATE TABLE locations3 (
  NoDVD integer,
  DateLocation date,
  NoClient integer,
  DureeLocation integer,
  PRIMARY KEY (NoDVD, DateLocation),
  FOREIGN KEY (NoDVD) references dvds3(NoDVD)
);

